import React from "react";
import SignUp from "./Signup";

const Covid = () => {
  return (
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6} lg={6}>
          <TextField
            autoComplete="fname"
            name="firstName"
            variant="outlined"
            required
            fullWidth
            id="firstName"
            label="Name"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>


        <Grid item xs={12}>
          <TextField
            variant="outlined"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>

        <Grid item xs={12} sm={6} lg={6}>
          <TextField
            autoComplete="fname"
            name=""
            variant="outlined"
            required
            fullWidth
            id="firstName"
            label="PhoneNumber"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>

        <Grid item xs={12}>
          <TextField
            variant="outlined"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="current-password"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>
      </Grid>


  );
};

export default Covid;
